(2, 1, 1, 'salads', 'salad-5', '<p>chicken, kale, iceberg klettuce, </p>\r\n', '1495912070.jpg', 2, 1, '2017-07-30 14:20:22', '2017-07-30 14:20:22'),
(3, 1, 1, 'sides', 'sides-3-5-5-5-5', '<p>all natural chicken tenders with ranch or bbq dipping sauce</p>\r\n', '1495912124.jpg', 3, 1, '2017-07-30 14:18:43', '2017-07-30 14:18:43'),
(4, 1, 1, 'desserts', 'deserts-5-5-5', '<p>Description about gluten free brownie will come here. .</p>\r\n', '1495912169.jpg', 4, 1, '2017-07-31 03:08:18', '2017-07-31 03:08:18'),
