INSERT INTO `contents` (`page_id`, `page_title`, `page_slug`, `page_sub_title`, `page_content`, `status`, `page_added_date`, `page_modified_date`) VALUES
(1, 'catering with nkd', 'cater-with-us', 'whether it\'s work or pleasure, let us help you cater for your event or party.', '<p>if you&#39;re hosting a special event then why not ask about using our pizza truck &ndash; let us help you make a great party even better!</p>\r\n', 'Publish', '2017-07-19 14:15:38', '2017-08-10 19:43:16'),
(2, 'join our team', 'join-our-team', 'become part of nkd', '<ul>\r\n	<li>A passion for great food and&nbsp;amazing customer service.</li>\r\n	<li>An unyielding approach to maintaining the highest&nbsp;standards.</li>\r\n	<li>A desire to be part of a winning team.</li>\r\n	<li>The ability to keep remain calm&nbsp;when the pressure is on.</li>\r\n	<li>Impeccable communication skills.</li>\r\n	<li>A love of pizza!</li>\r\n</ul>\r\n', 'Publish', '2017-07-19 14:15:38', '2017-08-10 20:16:36'),
(3, 'why nkd pizza?', 'why-nkd-pizza', '', '<p><strong>More than ever, consumers want new alternatives to traditional fast-food. </strong></p>\r\n\r\n<p>People want food that consists of delicious&nbsp;yet carefully sourced ingredients. The consumer is calling for increased attention to be placed on freshness and sustainability, and that&#39;s what we&#39;re all about.</p>\r\n', 'Publish', '2017-07-19 14:15:38', '2017-08-10 19:38:54'),
(4, 'why nkd?', 'why-nkd', '', '<p>NKD is genuinely different. We strive to provide &lsquo;feel good&rsquo; pizza using the freshest possible ingredients, all delivered directly to your door. We make pizza that we feel good about serving and you feel good about eating.</p>\r\n\r\n<p>NKD Pizza was born (originally named World&rsquo;s Healthiest Pizza), with the ambitious aim of changing the way we eat fast food. In 2017, the NKD concept resonates more than ever with consumers, who now demand healthier, more sustainable and more convenient ways of eating.</p>\r\n\r\n<p>We are looking for like-minded people to join our tribe and be a part of the NKD story.</p>\r\n', 'Publish', '2017-07-19 14:15:38', '2017-08-10 19:39:03'),
(5, 'our model', 'our-model', '', '<p>Our model is a simple but successful one &ndash; carry out and delivery. We offer a product that makes people feel good about eating pizza.&nbsp;<br />\r\n<br />\r\nNKD&rsquo;s stores are typically 800 to 1,200 square feet. They don&rsquo;t need to be in prime locations as 70-80% of our business is delivery, but it&rsquo;s really important to be close to well-populated neighbourhoods.&nbsp;<br />\r\n<br />\r\nWe support our franchisees with site selection, construction assistance and ongoing support long after the doors have opened. Our experienced operations professionals will be with you every step of the way, offering the tools and guidance you will need to ensure your NKD Pizza journey is a success.</p>\r\n\r\n<p>Unlike major&nbsp;pizza chains that already have a widespread presence,&nbsp;NKD offers many opportunities for growth.</p>\r\n', 'Publish', '2017-07-19 14:15:38', '2017-08-10 19:40:10'),
(6, 'apply now', 'apply-now', '', '<p>If you want to join an international, growing franchise and think you have what it takes, click below to contact us for more information or to start the application process.&nbsp;</p>\r\n', 'Publish', '2017-07-19 14:15:38', '2017-08-10 19:40:17'),
(7, 'franchising information', 'franchising-info', 'become our partner', '', 'Publish', '2017-07-19 14:15:38', '2017-08-17 09:00:44'),
(8, 'terms of use', 'terms-of-use', '', '<p><br />\r\n<strong>Our terms</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>1. These terms</strong></p>\r\n\r\n<p>1.1 What these terms cover. These are the terms and conditions on which we, NKD International Pizza Restaurant LLC, supply Products (pizzas and fast food and beverages) to you via the website (<a href="https://www.nkdpizza.com/">https://www.nkdpizza.com/</a>) or mobile applications (&ldquo;the Sites&rdquo;).&nbsp; Your use of the Sites, and any orders you place, is governed by the <a href="http://www.nkdpizza.com/privacy">Privacy and Cookies Policy</a>. Please take the time to read these, as they include important terms which apply to you</p>\r\n\r\n<p>1.2 Why you should read them. Please read these terms carefully before you submit your order to us. These terms tell you who we are, how we will provide Products to you, how you and we may change or end the contract, what to do if there is a problem and other important information. If you think that there is a mistake in these terms or require any changes, please contact us to discuss.&nbsp;&nbsp; These terms will apply to any orders you place.</p>\r\n\r\n<p>By placing an order, you agree to be bound by these terms and conditions. If you do not accept these terms and conditions, please do not place an order. These terms apply to orders placed in the United Arab Emirates.</p>\r\n\r\n<p><strong>2. Information about us and how to contact us</strong></p>\r\n\r\n<p>2.1 Who we are.&nbsp; NKD International Pizza Restaurant LLC, a company registered in Dubai. Our registered office is at G05 West Avenue Building, Dubai Marina, Dubai, United Arab Emirates.</p>\r\n\r\n<p>2.2 How to contact us. You can contact us by emailing us at marketing@nkdpizza.com or calling your local NKD pizza store (&ldquo;Local Store&rdquo;).</p>\r\n\r\n<p>2.3 How we may contact you. If we have to contact you we will do so by telephone or by writing to you at the email address or postal address you provided to us in your order.</p>\r\n\r\n<p>2.4 &quot;Writing&quot; includes emails. When we use the words &quot;writing&quot; or &quot;written&quot; in these terms, this includes emails.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>3. Your Order</strong></p>\r\n\r\n<p>3.1 Submitting your order. You must submit your order using the appropriate ordering facility provided on the Sites. You must be at least 18 years old to place an order.&nbsp; By submitting an order, you warrant that you are at least 18 years old and you are legally capable of entering into binding contracts.</p>\r\n\r\n<p>3.2 How we will accept your order. Our acceptance of your order will take place when we email you to accept it, at which point a contract will come into existence between us.</p>\r\n\r\n<p>3.3 If we cannot accept your order. If we are unable to accept your order, we will inform you of this and will not charge you for the Products ordered. This might be because there is a minimum delivery spend; you want the Products delivered to an area outside the delivery area of any Local Store (you can still collect the Products from the Local Store); the Products or a Product is out of stock; there are unexpected limits on your Local Stores resources which we could not reasonably plan for; we have identified an error in the price or description of a Product; or we are unable to meet a delivery deadline you have specified.</p>\r\n\r\n<p>3.4 Your order number. We will assign an order number to your order and tell you what it is when we accept your order. It will help us if you can tell us the order number whenever you contact us about your order.</p>\r\n\r\n<p>3.5 Geographical Restrictions. The Sites are solely for the promotion of Products in geographies where we have Local Stores. Unfortunately, we do not deliver to addresses outside a specific radius of a Local Store.&nbsp; These terms apply to customers in the UAE only.</p>\r\n\r\n<p>3.6 Payment for your Order.&nbsp; Payments for orders placed via the Sites must be paid by either:</p>\r\n\r\n<p>(a) PayPal</p>\r\n\r\n<p>(b) Credit Card: Visa and Mastercard are accepted</p>\r\n\r\n<p>(c) Debit Card:&nbsp; Visa and Mastercard are accepted</p>\r\n\r\n<p>(d) Other forms of acceptable payment as stated on the Sites</p>\r\n\r\n<p>Prices for Products are set out in the Sites and may change from time to time however price changes will not impact orders already accepted. &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>4. Price and payment</strong></p>\r\n\r\n<p>4.1 Where to find the prices for Products. The prices for Products (which include local tax unless stated) will be the price indicated on the order pages when you placed your order. We take all reasonable care to ensure that the price of each Product advised to you is correct. However please see clause 4.2 for what happens if we discover an error in the price of a Product you order.</p>\r\n\r\n<p>4.2 What happens if we got the price wrong. It is always possible that, despite our best efforts, some of the Products we sell may be incorrectly priced. We will normally check prices before accepting your order. Where the Product&#39;s correct price at your order date is less than our stated price at your order date, we will charge the lower amount. If the Product&#39;s correct price at your order date is higher than the price stated to you, we may contact you for your instructions before we accept your order.&nbsp; Otherwise, we may reject the order and notify you accordingly. If we accept and process your order where a pricing error is obvious and unmistakeable and could reasonably have been recognised by you as a mispricing, we may end the contract and refund you any sums you have paid.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>5. Our products</strong></p>\r\n\r\n<p>5.1 Products may vary slightly from their pictures. The images of Products on the Sites are for illustrative purposes only. Although we have made every effort to display the colours accurately, we cannot guarantee that a device&#39;s display of the colours accurately reflects the colour of the Products. Your Product may vary slightly from those images. Although we have made every effort to be as accurate as possible, because our Products are handmade, all sizes, weights, capacities, dimensions and measurements indicated on the Sites may vary slightly.</p>\r\n\r\n<p>5.2 Product packaging may vary. The packaging of Products may vary from that shown in images on the Sites.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>6. Providing the products</strong></p>\r\n\r\n<p>6.1 Delivery costs. The costs of delivery of the Products will be as displayed to you on the Sites.</p>\r\n\r\n<p>6.2 When we will provide the goods. During the order process, you can select a delivery window and we will only accept your order if we can deliver the goods within the delivery window.&nbsp; We will begin the services of preparing your order once we accept your order or at least 45 minutes before the start of the delivery window.</p>\r\n\r\n<p>6.3 We are not responsible for delays outside our control. If our supply and delivery of the Products is delayed by an event outside our control then we will contact you as soon as possible to let you know and we will take steps to minimise the effect of the delay. Provided we do this we will not be liable for delays caused by the event, but if we are unable to provide the Order at all on the day for delivery or the delay is substantial, you may contact us to end the contract and receive a refund for any Products you have paid for but not received.</p>\r\n\r\n<p>6.4 Collection by you. If you have asked to collect the Products from your Local Store, you can collect them at the time indicated and agreed as part of the order process.</p>\r\n\r\n<p>6.5 If you are not at home when the Product is delivered. If no one is available at your address to take delivery, we will leave you a note informing you of either, (i) how to rearrange delivery (subject to payment of a delivery fee) or (ii) that you need to collect the Products from your Local Store (subject to a reasonable time limit specified in the note).</p>\r\n\r\n<p>6.6 If you do not re-arrange delivery. If you do not collect the Products from us as arranged or if, after a failed delivery to you, you do not re-arrange delivery or collect the Products from your Local Store, we will contact you for further instructions. If, despite our reasonable efforts, we are unable to contact you or re-arrange delivery or collection we may end the contract and clause 9.2 will apply.</p>\r\n\r\n<p>6.7 Your legal rights if we deliver Products late. You have legal rights if we deliver any Products late. If we miss the delivery deadline for any Products then you may treat the contract as at an end straight away if any of the following apply:</p>\r\n\r\n<p>(a) we have refused to deliver the Products; or</p>\r\n\r\n<p>(b) we agreed to guarantee a specific delivery slot.</p>\r\n\r\n<p>6.8 Setting a new deadline for delivery. If you do not wish to treat the contract as at an end straight away under clause 6.7, you can give us a new deadline for delivery, which must be reasonable, and you can treat the contract as at an end if we do not meet the new deadline.</p>\r\n\r\n<p>6.9 Ending the contract for late delivery. If you do choose to treat the contract as at an end for late delivery under clauses 6.7 and 6.8, you can cancel your order for any of the Products by calling your Local Store or reject Products that have been delivered. After that, we will refund any sums you have paid to us for the cancelled Products and their delivery.&nbsp; If you have accepted the delivery of the Products despite late delivery, we may ask that you either return them in person to the Local Store you bought them from, or contact the Local Store and allow the Local Store to collect them from you.</p>\r\n\r\n<p>6.10 What will happen if you do not give required information to us. We may need certain information from you so that we can deliver the Products to you, for example, your address and telephone number. You must provide this information when ordering the Products or we may (but do not have to) contact you to ask for this information. If you did not give us this information when you order or do not provide the information within a reasonable time of us asking for it, or if you give us incomplete or incorrect information, we may end the contract (and clause 9.2 will apply). We will not be responsible for supplying the Products late or not supplying them if this is caused by you not giving us the information we need.</p>\r\n\r\n<p>6.11 Reasons we may suspend the supply of Products to you. We may have to suspend the supply of a Product to deal with technical problems or make minor technical changes.</p>\r\n\r\n<p>6.12 Your rights if we suspend the supply of Products. We will contact you in advance to tell you we will be suspending delivery of the Products, unless the problem is urgent or an emergency. You may contact us to end the contract for the Products if we suspend any part of your order, or tell you we are going to suspend it, and we will refund any sums you have paid in advance for the Products in respect of the period after you end the contract.</p>\r\n\r\n<p>6.13 We may also suspend supply of the Products if you do not pay. If you do not pay us for the Products when you are supposed to, we may suspend supply of the Products until you have paid us the outstanding amounts. We will contact you to tell you we are suspending supply of the Products for this reason.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>7. Your rights to end the contract</strong></p>\r\n\r\n<p>7.1 You can always end your contract with us.&nbsp; Your rights when you end the contract will depend on what you have bought, whether there is anything wrong with it, how we are performing and when you decide to end the contract:</p>\r\n\r\n<p>(a) If what you have bought is damaged or misdescribed, you may have a legal right to end the contract and get some or all of your money back, or to get replacement Products;</p>\r\n\r\n<p>(b) If you have just changed your mind about the Product, you may be able to get a refund if you amend or cancel your order in time &ndash; see clause 7.3;</p>\r\n\r\n<p>(c) In all other cases (if we are not at fault and there is no right to change your mind), you can still cancel delivery of your order but you will not be entitled to a refund.&nbsp; See clause 7.4.</p>\r\n\r\n<p>7.2 Ending the contract because of something we have done or are going to do. If you are ending a contract for a reason set out at (a) to (e) below, the contract will end immediately and we will refund you in full for any Products which have not been provided. The reasons are:</p>\r\n\r\n<p>(a) we have told you about a change to the Product or these terms which you do not agree to after you have made your order;</p>\r\n\r\n<p>(b) we have told you about an error in the price or description of the Product you have ordered and you do not wish to proceed;</p>\r\n\r\n<p>(c) there is a risk that supply of the Products may be significantly delayed because of events outside our control;</p>\r\n\r\n<p>(d) we have suspended supply of the Products for technical reasons, or notify you we are going to suspend them for technical reasons; or</p>\r\n\r\n<p>(e) you have a legal right to end the contract because of something we have done wrong (including because we have delivered late (see clause 6.7).</p>\r\n\r\n<p>7.3 Your right to change your mind.&nbsp; You can only amend or cancel your order or change your delivery time no later than 45 minutes prior to the start of the delivery window you have booked.</p>\r\n\r\n<p>7.4 Ending the contract where we are not at fault and there is no right to change your mind. Even if we are not at fault and you do not have a right to change your mind, you can still cancel your order and end the contract before it is completed, but you may lose your payment. If you want to cancel your order and / or end a contract before it is completed where we are not at fault and you have changed your mind, just contact your Local Store to let us know. The contract will end immediately.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>8. How to end the contract with us (including if you have changed your mind)</strong></p>\r\n\r\n<p>8.1 Tell us you want to end the contract. To end the contract with us, please let us know by doing one of the following:</p>\r\n\r\n<p>(a) Phone or email. Call your Local Store on the number listed on the Sites, or email marketing@nkdpizza.com Please provide your name, home address, details of the order and, where available, your phone number and email address.</p>\r\n\r\n<p>(b) Online. Complete the feedback form located on our website.</p>\r\n\r\n<p>8.2 How we will refund you.&nbsp; If you end your contract with us and you are entitled to a refund, we will refund you the price you paid for the Products including delivery costs, by the method you used for payment.</p>\r\n\r\n<p>8.3 When your refund will be made. We will make any refunds due to you as soon as possible and usually within 14 days of when the contract ends.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>9. Our rights to end the contract</strong></p>\r\n\r\n<p>9.1 We may end the contract if you break it. We may end the contract at any time by writing to you if:</p>\r\n\r\n<p>(a) you do not, within a reasonable time of us asking for it, provide us with information that is necessary for us to provide the Products;</p>\r\n\r\n<p>(b) you do not, within a reasonable time, allow us to deliver the Products to you or collect them from us;</p>\r\n\r\n<p>(c) you cancel your order outside of the permitted time frame / delivery window.&nbsp; See clause 7.3.</p>\r\n\r\n<p>9.2 You must compensate us if you break the contract. If we end the contract in the situations set out in clause 9.1 we will not refund any money you have paid in advance for Products.</p>\r\n\r\n<p><br />\r\n<strong>10. If there is a problem with the product</strong></p>\r\n\r\n<p>10.1 How to tell us about problems. If you have any questions or complaints about the Product, please contact us. You can call the Local Store or write to us at marketing@nkdpizza.com.</p>\r\n\r\n<p>10.2 Summary of your legal rights. We are under a legal duty to supply Products that are in conformity with this contract. Nothing in these terms will affect your legal rights.</p>\r\n\r\n<p>10.3 Your obligation to return rejected Products. If you wish to exercise your legal rights to reject Products and if we demand it, you must either return the Products in person to your Local Store or allow us to collect them from you. We will pay the costs of collection. Please call the Local Store or email us at marketing@nkdpizza.com to arrange collection.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>11. Our responsibility for loss or damage suffered by you</strong></p>\r\n\r\n<p>11.1 We are responsible to you for foreseeable loss and damage caused by us. If we fail to comply with these terms, we are responsible for loss or damage you suffer that is a foreseeable result of our breaking this contract or our failing to use reasonable care and skill, but we are not responsible for any loss or damage that is not foreseeable. Loss or damage is foreseeable if either it is obvious that it will happen or if, at the time the contract was made, both we and you knew it might happen, for example, if you discussed it with us during the sales process.</p>\r\n\r\n<p>11.2 We do not exclude or limit in any way our liability to you where it would be unlawful to do so. This includes liability for death or personal injury caused by our negligence or the negligence of our employees, agents or subcontractors; for fraud or fraudulent misrepresentation; for breach of your legal rights in relation to the Products including the right to receive Products which are: as described and match information we provided to you; of satisfactory quality; fit for any particular purpose made known to us; supplied with reasonable skill and care, and for defective products.</p>\r\n\r\n<p>11.3 When we are liable for damage to your property. If we are delivering Products to your property, we will make good any damage to your property caused by us while doing so. However, we are not responsible for the cost of repairing any pre-existing faults or damage to your property that we discover while providing the services.</p>\r\n\r\n<p>11.4 We are not liable for business losses. We only supply the Products for domestic and private use. If you use the Products for any commercial, business or re-sale purpose we will have no liability to you for any loss of profit, loss of business, business interruption, or loss of business opportunity.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>12. How we may use your personal information</strong></p>\r\n\r\n<p>12.1 How we will use your personal information. We will use the personal information you provide to us:</p>\r\n\r\n<p>(a) to supply the Products to you;</p>\r\n\r\n<p>(b) to process your payment for the Products; and</p>\r\n\r\n<p>(c) if you agreed to this during the order process, to give you information about similar Products that we provide, but you may stop receiving this at any time by contacting us.</p>\r\n\r\n<p>12.2 We will only give your personal information to third parties where the law either requires or allows us to do so.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>13. Other important terms</strong></p>\r\n\r\n<p>13.1 We may transfer this agreement to someone else. We may transfer our rights and obligations under these terms to another organisation.</p>\r\n\r\n<p>13.2 You need our consent to transfer your rights to someone else. You may only transfer your rights or your obligations under these terms to another person if we agree to this in writing. We may not agree if you do not inform us of changes in delivery at least 45 minutes before the agreed delivery window starts.</p>\r\n\r\n<p>13.3 If a court finds part of this contract illegal, the rest will continue in force. Each of the paragraphs of these terms operates separately. If any court or relevant authority decides that any of them are unlawful, the remaining paragraphs will remain in full force and effect.</p>\r\n', 'Publish', '2017-07-19 14:15:38', '2017-08-28 07:42:35'),
(9, 'privacy & cookies policy', 'privacy-policy', '', '<p>&nbsp;</p>\r\n\r\n<p><strong>NKD Pizza privacy &amp; cookies policy</strong></p>\r\n\r\n<ul>\r\n	<li>This policy (together with our terms of use at <a href="http://www.nkdpizza.com/terms">www.nkdpizza.com/terms</a> and any other documents referred to on it) sets out the basis on which any personal data we collect from you, or that you provide to us, will be processed by us.&nbsp; Please read the following carefully to understand our views and practices regarding your personal data and how we will treat it. By visiting <a href="http://www.nkdpizza.com">www.nkdpizza.com</a> you are accepting and consenting to the practices described in this policy.</li>\r\n	<li>For the purpose of the Data Protection Act 1998 (the Act), the data controller is NKD Pizza Europe Limited of 96 Kensington High Street, London, United Kingdom, W8 4SG.</li>\r\n</ul>\r\n\r\n<p><strong>Information we collect from you</strong></p>\r\n\r\n<ul>\r\n	<li>We will collect and process the following data about you:</li>\r\n</ul>\r\n\r\n<p><strong>Information you give us</strong></p>\r\n\r\n<ul>\r\n	<li>This is information about you that you give us by filling in forms on our site at www.nkdpizza.com (our site) or by corresponding with us by phone, e-mail or otherwise. It includes information you provide when you register to use our site, subscribe to our service, search for a product, place an order on our site, participate in social media functions on our site, enter a competition, promotion or survey, make an enquiry and when you report a problem with our site. The information you give us may include your name, address, e-mail address and phone number, financial and credit card information.</li>\r\n</ul>\r\n\r\n<p><strong>Information we collect about you</strong></p>\r\n\r\n<ul>\r\n	<li>With regard to each of your visits to our site we will automatically collect the following information:\r\n	<ul>\r\n		<li>technical information, including the Internet protocol (IP) address used to connect your computer to the Internet, your login information, browser type and version, time zone setting, browser plug-in types and versions, operating system and platform;</li>\r\n		<li>information about your visit, including the full Uniform Resource Locators (URL), clickstream to, through and from our site (including date and time), products you viewed or searched for, page response times, download errors, length of visits to certain pages, page interaction information (such as scrolling, clicks, and mouse-overs), methods used to browse away from the page, and any phone number used to call our customer service number.</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p><strong>Information we receive from other sources</strong></p>\r\n\r\n<ul>\r\n	<li>This is information we receive about you if you use any of the other websites we operate or the other services we provide. In this case we will have informed you when we collected that data if we intend to share those data internally and combine it with data collected on this site. We will also have told you for what purpose we will share and combine your data. We are working closely with third parties (including, for example, business partners, sub-contractors in technical, payment and delivery services, advertising networks, analytics providers, search information providers, credit reference agencies). We will notify you when we receive information about you from them and the purposes for which we intend to use that information.</li>\r\n</ul>\r\n\r\n<p><strong>Other Information we retain which you either give us which we collect from you</strong></p>\r\n\r\n<ul>\r\n	<li>We may collect other information from you including your interests, preferences, purchasing behaviour, transactional information, geographical location and demographics (e.g., age, gender, and income information).</li>\r\n</ul>\r\n\r\n<p><strong>Cookies</strong></p>\r\n\r\n<ul>\r\n	<li>Our website uses cookies to distinguish you from other users of our website. This helps us to provide you with a good experience when you browse our website and also allows us to improve our site. By continuing to browse the site, you are agreeing to our use of cookies.</li>\r\n	<li>A cookie is a small file of letters and numbers that we store on your browser or the hard drive of your computer if you agree. Cookies contain information that is transferred to your computer&#39;s hard drive.We use the following cookies:</li>\r\n</ul>\r\n\r\n<p><strong>Strictly necessary cookies</strong></p>\r\n\r\n<ul>\r\n	<li>These are cookies that are required for the operation of our website. They include, for example, cookies that enable you to log into secure areas of our website, use a shopping cart or make use of e-billing services.</li>\r\n</ul>\r\n\r\n<p><strong>Analytical/performance cookies</strong></p>\r\n\r\n<ul>\r\n	<li>They allow us to recognise and count the number of visitors and to see how visitors move around our website when they are using it. This helps us to improve the way our website works, for example, by ensuring that users are finding what they are looking for easily.</li>\r\n</ul>\r\n\r\n<p><strong>Functionality cookies</strong></p>\r\n\r\n<ul>\r\n	<li>These are used to recognise you when you return to our website. This enables us to personalise our content for you, greet you by name and remember your preferences (for example, your choice of language or region).</li>\r\n</ul>\r\n\r\n<p><strong>Targeting cookies</strong></p>\r\n\r\n<ul>\r\n	<li>These cookies record your visit to our website, the pages you have visited and the links you have followed. We will use this information to make our website and the advertising displayed on it more relevant to your interests. We may also share this information with third parties for this purpose.</li>\r\n</ul>\r\n\r\n<p>Please note that third parties (including, for example, advertising networks and providers of external services like web traffic analysis services) may also use cookies, over which we have no control. These cookies are likely to be analytical/performance cookies or targeting cookies</p>\r\n\r\n<ul>\r\n	<li>You block cookies by activating the setting on your browser that allows you to refuse the setting of all or some cookies. However, if you use your browser settings to block all cookies (including essential cookies) you may not be able to access all or parts of our site. Except for essential cookies, all cookies will expire after 2 hours.</li>\r\n</ul>\r\n\r\n<p><strong>Uses made of the information</strong></p>\r\n\r\n<ul>\r\n	<li>We use information held about you in the following ways:</li>\r\n</ul>\r\n\r\n<p><strong>Information you give to us</strong></p>\r\n\r\n<ul>\r\n	<li>We will use this information:\r\n	<ul>\r\n		<li>to carry out our obligations arising from any contracts entered into between you and us and to provide you with the information, products and services that you request from us;</li>\r\n		<li>provided we first obtain your consent, to provide you with information about other goods and services we offer that are similar to those that you have already purchased or enquired about;</li>\r\n		<li>provided we first obtain your consent, to provide you, or permit selected third parties to provide you, with information about goods or services we feel may interest you. If you are an existing customer, we will only contact you by electronic means (e-mail or SMS) with information about goods and services similar to those which were the subject of a previous sale or negotiations of a sale to you. If you are a new customer, and where we permit selected third parties to use your data, we (or they) will contact you by electronic means only if you have consented to this. If you do not want us to use your data in this way, or to pass your details on to third parties for marketing purposes, please tick the relevant box situated on the form on which we collect your data (the order form or registration form);</li>\r\n		<li>to notify you about changes to our service;</li>\r\n		<li>to ensure that content from our site is presented in the most effective manner for you and for your computer.</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p><strong>Information we collect about you</strong></p>\r\n\r\n<ul>\r\n	<li>We will use this information:\r\n	<ul>\r\n		<li>to administer our site and for internal operations, including troubleshooting, data analysis, testing, research, statistical and survey purposes;</li>\r\n		<li>to improve our site to ensure that content is presented in the most effective manner for you and for your computer;</li>\r\n		<li>to allow you to participate in interactive features of our service, when you choose to do so;</li>\r\n		<li>as part of our efforts to keep our site safe and secure;</li>\r\n		<li>to measure or understand the effectiveness of advertising we serve to you and others, and to deliver relevant advertising to you;</li>\r\n		<li>to make suggestions and recommendations to you and other users of our site about goods or services that may interest you or them.</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p><strong>Information we receive from other sources</strong></p>\r\n\r\n<ul>\r\n	<li>We will combine this information with information you give to us and information we collect about you. We will use this information and the combined information for the purposes set out above (depending on the types of information we receive).</li>\r\n</ul>\r\n\r\n<p><strong>Disclosure of your information</strong></p>\r\n\r\n<ul>\r\n	<li>You agree that we have the right to share your personal information with:\r\n	<ul>\r\n		<li>Any member of our group, which means our subsidiaries, our ultimate holding company and its subsidiaries, as defined in section 1159 of the UK Companies Act 2006.</li>\r\n		<li>Selected third parties including:\r\n		<ul>\r\n			<li>business partners, suppliers and sub-contractors for the performance of any contract we enter into with them or you;</li>\r\n			<li>advertisers and advertising networks that require the data to select and serve relevant adverts to you and others.&nbsp; We do not disclose information about identifiable individuals to our advertisers, but we will provide them with aggregate information about our users (for example, we may inform them that 500 men aged under 30 have clicked on their advertisement on any given day). We may also use such aggregate information to help advertisers reach the kind of audience they want to target (for example, women in SW1). We may make use of the personal data we have collected from you to enable us to comply with our advertisers&#39; wishes by displaying their advertisement to that target audience; and</li>\r\n			<li>analytics and search engine providers that assist us in the improvement and optimisation of our site.</li>\r\n		</ul>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p><strong>We will disclose your personal information to third parties</strong></p>\r\n\r\n<ul>\r\n	<li>In the event that we sell or buy any business or assets, in which case we will disclose your personal data to the prospective seller or buyer of such business or assets.</li>\r\n	<li>If NKD Pizza Europe Limited or substantially all of its assets are acquired by a third party, in which case personal data held by it about its customers will be one of the transferred assets.</li>\r\n	<li>If we are under a duty to disclose or share your personal data in order to comply with any legal obligation, or in order to enforce or apply our terms of use terms and conditions of supply www.nkdpizza.com/terms and other agreements; or to protect the rights, property, or safety of NKD Pizza Europe Limited, our customers, or others. This includes exchanging information with other companies and organisations for the purposes of fraud protection and credit risk reduction.</li>\r\n</ul>\r\n\r\n<p><strong>Where we store your personal data</strong></p>\r\n\r\n<ul>\r\n	<li>The data that we collect from you may be transferred to, and stored at, a destination outside the European Economic Area (&quot;EEA&quot;). It will also be processed by staff operating outside the EEA who work for us or for one of our suppliers. This includes staff engaged in, among other things, the fulfilment of your order, the processing of your payment details and the provision of support services. By submitting your personal data, you agree to this transfer, storing or processing. We will take all steps reasonably necessary to ensure that your data is treated securely and in accordance with this privacy policy.</li>\r\n	<li>All information you provide to us is stored on our secure servers. Any payment transactions will be encrypted using SSL technology. Where we have given you (or where you have chosen) a password which enables you to access certain parts of our site, you are responsible for keeping this password confidential. We ask you not to share a password with anyone.</li>\r\n	<li>Unfortunately, the transmission of information via the internet is not completely secure. Although we will do our best to protect your personal data, we cannot guarantee the security of your data transmitted to our site; any transmission is at your own risk. Once we have received your information, we will use strict procedures and security features to try to prevent unauthorised access.</li>\r\n</ul>\r\n\r\n<p><strong>Your rights</strong></p>\r\n\r\n<ul>\r\n	<li>You have the right to ask us not to process your personal data for marketing purposes. We will usually inform you (before collecting your data) if we intend to use your data for such purposes or if we intend to disclose your information to any third party for such purposes. You can exercise your right to prevent such processing by checking certain boxes on the forms we use to collect your data.&nbsp; You can also exercise the right at any time by contacting us at 96 Kensington High Street, London, United Kingdom, W8 4SG<strong> OR</strong> marketing@nkdpizza.com.</li>\r\n	<li>Our site may, from time to time, contain links to and from the websites of our partner networks, advertisers and affiliates.&nbsp; If you follow a link to any of these websites, please note that these websites have their own privacy policies and that we do not accept any responsibility or liability for these policies.&nbsp; Please check these policies before you submit any personal data to these websites.</li>\r\n</ul>\r\n\r\n<p><strong>Access to information</strong></p>\r\n\r\n<ul>\r\n	<li>The Act gives you the right to access information held about you. Your right of access can be exercised in accordance with the Act. Any access request will be subject to a fee of &pound;10 to meet our costs in providing you with details of the information we hold about you.</li>\r\n</ul>\r\n\r\n<p><strong>Changes to our privacy policy</strong></p>\r\n\r\n<ul>\r\n	<li>Any changes we make to our privacy policy in the future will be posted on this page and, where appropriate, notified to you by e-mail. Please check back frequently to see any updates or changes to our privacy policy.</li>\r\n</ul>\r\n\r\n<p><strong>Contact</strong></p>\r\n\r\n<ul>\r\n	<li>Questions, comments and requests regarding this privacy policy are welcomed and should be addressed to 96 Kensington High Street, London, United Kingdom, W8 4SG<strong> OR</strong> marketing@nkdpizza.com.</li>\r\n</ul>\r\n', 'Publish', '2017-07-19 14:15:38', '2017-08-24 18:37:18');
