INSERT INTO `email_templates` (`template_id`, `template_name`, `template_key`, `from_name`, `from_email`, `email_subject`, `email_body`, `template_status`, `template_added_date`, `template_modified_date`) VALUES
(1, 'forgot_password_email', 'forgot_password_email', 'NKD PIZZA', 'ordernow@nkdpizza.com', 'Forgot password', '<p>Dear {name}, Your password has been reset and new password is: {password}</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thanks,</p>\r\n\r\n<p>NKD Pizza</p>\r\n', 'Active', '2013-04-23 17:18:19', '2017-08-10 20:44:50'),
(2, 'Store Registration', 'store_registration', 'NKD PIZZA', 'ordernow@nkdpizza.com', 'Store Registration', '<p>Dear {name}, Your booking has been confirmed.</p>\r\n\r\n<p>Your details are summarised&nbsp;below :</p>\r\n\r\n<p>Name : {name},</p>\r\n\r\n<p>Date of birth : {dob},</p>\r\n\r\n<p>Personal Health Number : {phn},</p>\r\n\r\n<p>Phone : {phone},</p>\r\n\r\n<p>Email : {email}</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thanks,</p>\r\n\r\n<p>NKD Pizza</p>\r\n', 'Active', '2017-02-23 22:17:31', '2017-08-12 09:02:02'),
(3, 'Catering Notification', 'catering_notification', 'NKD Pizza', 'ordernow@nkdpizza.com', 'Catering Notification', '<p>Hi,</p>\r\n\r\n<p>Just to let you know that we received your&nbsp;catering request with the following details :</p>\r\n\r\n<p>Name : {name},</p>\r\n\r\n<p>Email : {email},</p>\r\n\r\n<p>Phone : {phone},</p>\r\n\r\n<p>Location : {location},</p>\r\n\r\n<p>Event Date: {event_date},</p>\r\n\r\n<p>Number of people : {no_of_person},</p>\r\n\r\n<p>Special Instructions : {special_instruction}</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>One of the team will be in touch soon!</p>\r\n\r\n<p>Thanks,</p>\r\n\r\n<p>NKD Pizza</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Active', '2017-03-26 17:22:13', '2017-08-12 09:03:23'),
(4, 'Contact Notification', 'contact_notification', 'NKD Pizza', 'ordernow@nkdpizza.com', 'Contact Notification', '<p>Hi,</p>\r\n\r\n<p>We got a contact&nbsp;request with the following details :</p>\r\n\r\n<p>Name : {name},</p>\r\n\r\n<p>Email : {email},</p>\r\n\r\n<p>Phone : {phone},</p>\r\n\r\n<p>NKD Pizza location : {location},</p>\r\n\r\n<p>Question relates&nbsp;to : {question},</p>\r\n\r\n<p># of people : {feedback},</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thanks,</p>\r\n\r\n<p>NKD Pizza</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Active', '2017-03-26 17:22:13', '2017-08-10 20:46:50'),
(5, 'Coupon Notification', 'coupon_notification', 'NKD PIZZA', 'ordernow@nkdpizza.com', 'Coupon Notification', '<p>Hi,</p>\r\n\r\n<p>A coupon has been added, with the following details :</p>\r\n\r\n<p>Coupon Name: {coupon_name},</p>\r\n\r\n<p>Coupon Code : {coupon_code},</p>\r\n\r\n<p>Application : {application},</p>\r\n\r\n<p>Description : {description},</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thanks,</p>\r\n\r\n<p>NKD Pizza</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Active', '2017-03-26 17:22:13', '2017-08-10 20:47:14'),
(6, 'Registraion Notification', 'registraion_notification', 'NKD PIZZA', 'ordernow@nkdpizza.com', 'Registraion Notification', '<p>Hi {fname} {lname},</p>\r\n\r\n<p>Thanks for registering, your login details are&nbsp;below :</p>\r\n\r\n<p>Email :&nbsp;&nbsp;{email},</p>\r\n\r\n<p>Password &nbsp;: {password}</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thanks,</p>\r\n\r\n<p>NKD Pizza</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Active', '2017-03-26 17:22:13', '2017-08-10 20:47:40'),
(7, 'Order Confirmation', 'order_confirmation', 'NKD Pizza', 'ordernow@nkdpizza.com', 'Order Confirmation', '<p>Hi {username},</p>\r\n\r\n<p>Thanks for ordering with us, your order has been received and we&nbsp;will contact you soon.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thanks,</p>\r\n\r\n<p>NKD Pizza</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Active', '2017-03-26 17:22:13', '2017-08-10 20:49:36'),
(8, 'Career Notification', 'career_notification', 'NKD Pizza', 'ordernow@nkdpizza.com', 'Career Notification', '<p>Hi,</p>\r\n\r\n<p>We got a job enquiry with the following details :</p>\r\n\r\n<p>Name : {name},</p>\r\n\r\n<p>Email : {email},</p>\r\n\r\n<p>Phone : {phone},</p>\r\n\r\n<p>Position applied for : {position},</p>\r\n\r\n<p>Linkedin link&nbsp;: {lkdin},</p>\r\n\r\n<p>Resume : <a href="http://nkdpizza.com/beta/dev/attachments/{resume}" download >Download Resume</a>,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thanks,</p>\r\n\r\n<p>NKD Pizza</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Active', '2017-03-26 17:22:13', '2017-08-24 20:48:07'),
(9, 'Enquiry Notification', 'enquiry_notification', 'NKD Pizza', 'ordernow@nkdpizza.com', 'Enquiry Notification', '<p>Hi,</p>\r\n\r\n<p>We got a enquiry with the&nbsp;following details :</p>\r\n\r\n<p>Name : {name},</p>\r\n\r\n<p>Email : {email},</p>\r\n\r\n<p>Phone : {phone},</p>\r\n\r\n<p>Country : {country},</p>\r\n\r\n<p>City&nbsp;: {city},</p>\r\n\r\n<p>Feedback : {feedback},</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thanks,</p>\r\n\r\n<p>NKD Pizza</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Active', '2017-03-26 17:22:13', '2017-08-10 20:49:07'),
(10, 'User Acknowledgement', 'user_acknowledgement', 'NKD Pizza', 'ordernow@nkdpizza.com', 'Enquiry Confirmation ', '<p>Hello {name},</p>\r\n\r\n<p>Thanks&nbsp;for&nbsp;request&nbsp;with&nbsp;us, will contact you soon.</p>\r\n\r\n<p>Thanks,</p>\r\n\r\n<p><br />\r\nNKD Pizza</p>\r\n', 'Active', '2017-03-26 17:22:13', '2017-08-25 13:08:50');
